pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED

import "./Libraries/SafeMath.sol";

import "./Interfaces/IShyftCacheGraph.sol";

import "./Interfaces/ITrustChannelManager.sol";
import "./Interfaces/ITrustChannelRules.sol";
import "./Interfaces/ITrustChannelManager_Routing.sol";
import "./DataModels/DMTrustChannelRules.sol";

/// @dev
/// | A reference contract related to the Trust Channel Managers's routing contract, used for externally coordinating trusted asset flows.
/// | An example call within the Shyft Core Contracts architecture is within the ShyftCacheGraph.sol contract, which implements an asset flow.


contract TrustChannelManager_Routing is DMTrustChannelRules, ITrustChannelRules, ITrustChannelManager_Routing {
    /// @dev using the SafeMath library for any uint256 values.
    using SafeMath for uint256;

    /// @dev The owner of this contract.
    address owner = address(0);

    /// @dev The Shyft Cache Graph address that this contract is bound to.
    address shyftCacheGraphAddress = address(0);

    /// @dev The Trust Anchor Manager address that this contract is bound to.
    address trustChannelManagerAddress = address(0);

    /// @dev Initializes this contract with the owner set to the calling public address.

    constructor() {
        owner = msg.sender;
    }

    /// @param _shyftCacheGraphAddress The smart contract address for the Shyft Cache Graph that should be linked.
    /// @dev Links the Shyft Cache Graph to this contract's function flow.
    /// @return result
    ///    | false: [ will never return false due to require() ]
    ///    | true: shyft cache graph address set correctly

    function setShyftCacheGraphAddress(address _shyftCacheGraphAddress) public returns (bool result) {
        require(_shyftCacheGraphAddress != address(0));
        require(msg.sender == owner);

        shyftCacheGraphAddress = _shyftCacheGraphAddress;

        //shyft cache graph address set correctly
        return true;
    }

    /// @param _trustChannelManagerAddress The smart contract address for the Trust Channel Manager that should be linked.
    /// @dev Links Trust Channel Manager to this contract's function flow.
    /// @return result
    ///    | false: [ will never return false due to require() ]
    ///    | true: trust channel manager address set correctly

    function setTrustChannelManagerAddress(address _trustChannelManagerAddress) public returns (bool result) {
        require(_trustChannelManagerAddress != address(0));
        require(msg.sender == owner);

        trustChannelManagerAddress = _trustChannelManagerAddress;

        //trust channel manager address set correctly
        return true;
    }

    /// @param _senderIdentifiedAddress the sender's address
    /// @param _receiverIdentifiedAddress the receiver's address
    /// @param _amount the amount to transmit
    /// @param _bip32X_type the token type that is being transmitted
    /// @param _requiredConsentFromAllParties whether "consented" status is required from all parties
    /// @param _requiredActive whether an "active" status is required from the channel
    /// @dev | This function gets the relative KYC level on a transactional basis between two counterparties. Included in the checks are the baseline information that is needed to determine counterparty conditions.
    ///      | The other method of calling this function include parameters useful in an "Assured Asset" profile.
    /// @return relativeTrustLevel the relative trust level of the counterparties
    /// @return externalTrustLevel the external trust level of the counterparties

    //@note: assumes "active" and "active+consented", trust channel routes
    // also assumes that "dirty" graphs will not be passed in.
    function getRelativeTrustLevelOnlyClean(address _senderIdentifiedAddress,
                                            address _receiverIdentifiedAddress,
                                            uint256 _amount,
                                            uint256 _bip32X_type,
                                            bool _requiredConsentFromAllParties,
                                            bool _requiredActive) public override returns (int16 relativeTrustLevel, int16 externalTrustLevel) {
        //we avoid this check due to the "only clean" status, which is two compares and two storage reads
        // if (identifiedAddress_to_kycIdentity[_senderIdentifiedAddress].cacheGraph.graphStatus == CacheGraphStatus.Enabled
        // && identifiedAddress_to_kycIdentity[_receiverIdentifiedAddress].cacheGraph.graphStatus == CacheGraphStatus.Enabled) {

        uint32 trustChannelIndex;

        if (_requiredConsentFromAllParties == true) {
            trustChannelIndex = IShyftCacheGraph(shyftCacheGraphAddress).getActiveConsentedTrustChannelBitFieldForPair(_senderIdentifiedAddress, _receiverIdentifiedAddress);
        } else {
            trustChannelIndex = IShyftCacheGraph(shyftCacheGraphAddress).getActiveTrustChannelBitFieldForPair(_senderIdentifiedAddress, _receiverIdentifiedAddress);
        }

        if (trustChannelIndex != NoTrustChannel) {
            ITrustChannelManager trustChannelManager = ITrustChannelManager(trustChannelManagerAddress);

            (uint8 returnCode, uint256 foundChannelRulesBitField) = trustChannelManager.getActiveChannelRulesBitField(trustChannelIndex);

            if (returnCode == 1 && _requiredActive == true) {
                relativeTrustLevel = 0;
            } else if (returnCode > 0) {

                (relativeTrustLevel, externalTrustLevel) = IShyftCacheGraph(shyftCacheGraphAddress).calculateRelativeTrustLevel(trustChannelIndex, foundChannelRulesBitField, _senderIdentifiedAddress, _receiverIdentifiedAddress, _amount, _bip32X_type, _requiredConsentFromAllParties, _requiredActive);

                //                emit EVT_getRelativeTrustLevelOnlyCleanDebug(_senderIdentifiedAddress, _receiverIdentifiedAddress, _amount, _bip32X_type, _requiredConsentFromAllParties, _requiredActive);
                //                emit EVT_getRelativeTrustLevelOnlyCleanDebugExtra(returnCode, foundChannelRulesBitField, totalRules, rulesPassed, relativeTrustLevel, externalTrustLevel, externalRulesPassed);
            } else {
                //trust channel does not exist
                relativeTrustLevel = 0;
            }
        } else {
            relativeTrustLevel = 0;
        }

        //        ITrustAnchorStorage trustAnchorStorage = ITrustAnchorStorage(trustAnchorStorageAddress);

        return (relativeTrustLevel, externalTrustLevel);//identifiedAddress_to_kycIdentity[_identifiedAddress].cacheGraph.constructedLocalKycLevel;

        // //@note: here's the bloom filter in action, acting as a global aggregate of the whole. checks for
        // // zero value mean absolutely zero active attestations, without needing to check any external
        // // arrays.

        // if (documentActiveAggregateBloomFilter > 0) {
        //     //no bits set in "active" bloom filter, hence no valid KYC level.
        //     return 0;
        // } else {

        // }
    }

    /// @param _trustChannelIndex the Index for the Trust Channel this calculation is referencing
    /// @param _senderIdentifiedAddress the sender's address
    /// @param _receiverIdentifiedAddress the receiver's address
    /// @param _amount the amount to transmit
    /// @param _bip32X_type the token type that is being transmitted
    /// @param _requiredConsentFromAllParties whether "consented" status is required from all parties
    /// @param _requiredActive whether an "active" status is required from the channel
    /// @dev | An internal function to function generates the relative trust level of the counterparties in relation to all of the Rules set for this Trust Channel. This function checks for a Verification Policy, Amount Limits per transaction, and also enables external checks (defined by the Multisig administrators to the Trust Channel) via an other smart contract address.
    ///      | Externally referenced smart contracts have the same input/output types as defined in the "getExternalTrustLevel" function.
    /// @return success whether the external trust level returns success
    /// @return externalTrustLevel the external trust level of the counterparties in respect to the trust channel's routing rules

    function getExternalTrustLevel( uint32 _trustChannelIndex,
                                    address _senderIdentifiedAddress,
                                    address _receiverIdentifiedAddress,
                                    uint256 _amount,
                                    uint256 _bip32X_type,
                                    bool _requiredConsentFromAllParties,
                                    bool _requiredActive) public returns(bool success, int16 externalTrustLevel) {
        ITrustChannelManager trustChannelManager = ITrustChannelManager(trustChannelManagerAddress);

        //get the contract address from the rules storage, this is all that is needed to perform the next step
        address exDataContractAddress = address(uint160(uint256(trustChannelManager.getTrustChannelRulesStorage(_trustChannelIndex, uint8(trustChannelRulesEnum.ExternalRoutingContractEnforced), 0))));
        //address _senderIdentifiedAddress,
        //address _receiverIdentifiedAddress,
        //uint256 _amount,
        //uint256 _bip32X_type,
        //
        //uint256 _senderSafeAmount,
        //bool _requireMinimumAssets,
        //bool _requireBiometrics,
        //
        //bool _requiredConsentFromAllParties,
        //bool _requiredActive
        bytes4 sig = bytes4(keccak256(abi.encodePacked("getRelativeTrustLevelOnlyClean(address,address,uint256,uint256,bool,bool)")));

        bytes memory result;
        (success, result) = exDataContractAddress.call(abi.encodeWithSelector(sig, _senderIdentifiedAddress, _receiverIdentifiedAddress, _amount, _bip32X_type, _requiredConsentFromAllParties, _requiredActive));
        //check whether the rules' requirement for amount sent to be under or equal to this amount sent.
        //                        (_amount, _receiver, _tokenLeadContract, _expectedAmount, _expectedSC) = abi.decode(data, (uint, address, address, uint, address));
        int16 exDataExternalTrustLevel;
        (externalTrustLevel, exDataExternalTrustLevel) = abi.decode(result, (int16, int16));

        return (success, externalTrustLevel);
    }
}

